                null,
                "Comece a primeira puxada passando pelos calcanhares, estendendo os joelhos. O ângulo das costas deve permanecer o mesmo e os braços devem permanecer retos. Mova o peso com controle enquanto continua acima dos joelhos.",
                "Em seguida, vem a segunda puxada, a principal fonte de aceleração para o limpo. À medida que a barra se aproxima da posição do meio da coxa, comece a se estender pelos quadris. Em um movimento de salto, acelere estendendo os quadris, joelhos e tornozelos, usando a velocidade para mover a barra para cima. Não deve haver necessidade de puxar ativamente os braços para acelerar o peso; Ao final da segunda puxada, o corpo deve estar totalmente estendido, inclinando-se ligeiramente para trás, com os braços ainda estendidos.",
                "À medida que a extensão total é alcançada, faça a transição para a terceira puxada encolhendo os ombros agressivamente e flexionando os braços com os cotovelos para cima e para fora. No pico da extensão, puxe-se agressivamente para baixo, girando os cotovelos sob a barra ao fazê-lo. Receba a barra em uma posição de agachamento frontal, cuja profundidade depende da altura da barra no final da terceira puxada. A barra deve ser colocada sobre os ombros prolongados, tocando levemente a garganta com as mãos relaxadas. Continue a descer para a posição de agachamento inferior, o que ajudará na recuperação.",
                "Recupere-se imediatamente dirigindo pelos calcanhares, mantendo o tronco ereto e os cotovelos para cima. Continue até que você tenha se levantado para uma posição de pé."
