                "Ao apertar fortemente os glúteos e isquiotibiais, encha os pulmões de ar e, em uma subida lenta (contagem de três a seis segundos), expire lentamente. Dica: É importante apertar os glúteos e isquiotibiais, pois isso fará com que os flexores do quadril sejam inativados em um processo chamado inibição recíproca, o que basicamente significa que os músculos opostos aos contraídos relaxarão.",
