                "Como você tem os dois braços estendidos à sua frente, segurando a barra na largura de pegada escolhida, traga o tronco para trás cerca de 30 graus ou mais, criando uma curvatura na parte inferior das costas e esticando o peito. Esta é a sua posição inicial.",
