                "O braço com o haltere deve estar próximo ao tronco e alinhado com ele (levantado até ficar paralelo ao chão enquanto os antebraços estão apontando para o chão enquanto as mãos seguram os pesos). Dica: Deve haver um ângulo de 90 graus entre os antebraços e a parte superior do braço. Esta é a sua posição inicial.",
