                "De pé com o tronco reto e uma inclinação muito pequena para a frente, aproxime os braços do corpo e perpendicularmente ao chão. Os antebraços devem estar apontando para cima em direção à polia enquanto seguram a barra. Esta é a sua posição inicial.",
                "Usando o tríceps, abaixe a barra até que ela toque a frente das coxas e os braços fiquem totalmente estendidos perpendicularmente ao chão. Os braços devem permanecer sempre parados ao lado do tronco e apenas os antebraços devem se mover. Expire enquanto executa este movimento.",
